/* 사이트_전체에_적용 */
body, p, span, h1, h2, h3, h4, h5, h6, div, a {
  line-height: 2; /* 줄간격 2배 */
font-family: 'Pretendard', sans-serif !important;
}

html, body {
  margin: 0;
  padding: 0;
}

    h1 { text-align: center; }
    body {
  user-select: none;
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  text-align: center; }
    img { max-width: 100%; }
    .layout-block { display: flex; gap: 1rem; margin: 1rem 0; }
    .layout-column { flex: 1; }
    .button {
      display: inline-block;
      padding: 8px 16px;
      background-color: #000;
      color: #fff;
      text-decoration: none;
      margin-top: 6px;
      border-radius: 6px;
    }

    body {
      padding-top: 30px; /* 네비바_높이에_맞게_조정 */
    }

    section:first-of-type {
      scroll-margin-top: 80px; /* 앵커_이동 시_겹치지_않게 */
    }
    
@media (max-width: 768px) {
  body {
    padding: 2rem 1rem;
    font-size: 16px;
    line-height: 1.8;
  }

  h1, h2, h3 {
    font-size: 1.3rem;
    margin-bottom: 1rem;
  }

  p {
    font-size: 1rem;
    margin: rem auto;
    padding: 0 1rem;
    max-width: 80%;
  }

  iframe {
    width: 80% !important;
    max-width: 80% !important;
    margin: 1.5rem auto;
    display: block;
    border-radius: 8px;
  }
    
  .layout-block {
  width: 100vw;                /* 뷰포트 전체 너비 차지 */
  margin-left: calc(-50vw + 50%);  /* 부모 max-width 무효화 */
  padding: 0;                  /* 바깥 여백 제거 */
  border: none;                /* 개발용 테두리 제거 가능 */
  }

  }
